Provide support, product/market research, and moderate guidance to software development teams to help them arrive at effective software solutions. Responsibilities may include the development of operational blueprints, design sketches/drawings, specifications, and user interface mock-ups/wireframes;
Identify opportunities to improve and evolve existing BI solutions;
Assist with implementation of data quality improvement processes and initiatives and seek continuous business process improvement through the automation, streamlining, and enterprise consolidation of business processes and data sources used in business intelligence platform;
Plan and facilitate the User Acceptance Testing (UAT) process for all new product features, enhancements, and defect remediation;
Participate in project planning activities and provide support to the project manager to help develop and maintain project artifacts including tasks, timeline, milestones for the project plan; and
Represents the team through interaction with business users to gather analytic requirements.

Qualifications
Bachelors Degree in Healthcare, Technology, Engineering, Information Systems, or a related field required;

2+ years of business related work experience in one or more of the following areas: Business Intelligence, Reporting, Data Analysis, Data Management, and or Technology;
