Understanding of database systems including both relational and OLAP designs;
Understanding of ETL, data architecture and data management principles;
Ability to analyze data to identify deliverables, gaps and inconsistencies;
Proficient experience using Outlook, Word, Excel and PowerPoint;
Strong written, verbal, and interpersonal communication skills; and
Understanding of the development of reporting and visualization of data.

