Description

Citi, the leading global bank, has approximately 200 million customer accounts and does business in more than 160 countries and jurisdictions. Citi provides consumers, corporations, governments and institutions with a broad range of financial products and services, including consumer banking and credit, corporate and investment banking, securities brokerage, transaction services, and wealth management. Our core activities are safeguarding assets, lending money, making payments and accessing the capital markets on behalf of our clients.

Citis Mission and Value Proposition explains what we do and Citi Leadership Standards explain how we do it. Our mission is to serve as a trusted partner to our clients by responsibly providing financial services that enable growth and economic progress. We strive to earn and maintain our clients and the publics trust by constantly adhering to the highest ethical standards and making a positive impact on the communities we serve. Our Leadership Standards is a common set of skills and expected behaviors that illustrate how our employees should work every day to be successful and strengthens our ability to execute against our strategic priorities.

Diversity is a key business imperative and a source of strength at Citi. We serve clients from every walk of life, every background and every origin. Our goal is to have our workforce reflect this same diversity at all levels. Citi has made it a priority to foster a culture where the best people want to work, where individuals are promoted based on merit, where we value and demand respect for others and where opportunities to develop are widely available to all.

Job Purposes

As an integral part of the Enterprise Supply Chain framework, ESC Analytics is responsible for reporting and analysis on the end-to-end supply chain operations within Citigroup on a global basis. Within that the Data Sciences Team works with advanced technologies to develop predictive capabilities to support the ESC Functions, and various Citi Businesses that use third parties in their supply chains.

This role will focus on data exploration, extraction, analysis and presentation to support ESCs strategic mission. The ideal candidate will have a strong background in data modeling, coding (SQL, DAX, Power Query), and experience in complex problem solving. Additionally, have a passion for data analysis, discovery of next-gen tools and thrive in a highly complex environment.

Primary Responsibilities
Business Analysis: Interface with ESC business units to analyze business processes and document BI analytics requirements for rapid build of data visualizations based on global standards. Data Modeling: Design and build efficient, flexible and sustainable data models within Power Pivot (or other BI tool) based on analytic requirements to support decision making within the organization. Data Analysis: Query structured and unstructured data and perform complex data transformation using ETL tools (Power Query). Understand strengths and weakness of the data and have the ability to operate in the grey and make logically sound decisions to support data modeling. Statistical Analysis: Using statistical analysis, design algorithms that can be used as the basis of predictive trends and outlier identification. Visualizations: Develop comprehensive visualizations that supports and grow a data culture within the organization. Bring to the forefront process and expense opportunities to assist with strategic conversations through compelling visualizations. Analysis: Provide analytic insights through financial and supply chain experience.
Qualifications

Knowledge/Experience:
Prior experience with large data sets and querying enterprise data warehouses including relational database and SQL;
Strong data modeling technique, preferably using Power Pivot, and experience in simplifying complex data problems;
Strong ETL skills, preferably using Power Query, to feed robust financial data models and turn large data sets into easy to understand analysis used to make decisions;
Strong analytical knowledge to synthesize data and produce timely, accurate and relevant commentary
Procurement, Risk and Operational knowledge preferred, but not required;
Highly motivated self-starter that takes initiative and has the ability to effectively organize, multi-task and prioritize a wide array of projects
Prior experience working in a global team environment
Skills:
Excellent communication skills with the ability to interface with technical and non-technical audience and work well in a team environment;
Expert level technical knowledge using advanced BI tools and techniques to breakdown complex data problems and create robust data models;
Expert level business analysis skills to include problem solving, decision making, relationship building and management, detail oriented, documentation management;
Expert level of financial analytics knowledge to support insight analysis with the information available;
Ability to work with data from many different sources to build a logical data flow to support data modeling
Analytical and statistical skills with the ability to recognize data patterns, work of data intuition and continuously ask why;
Strategic thinking on problems solving and identification of opportunities;
Advanced communication/presentation skills as well as the ability to collect and share constructive feedback;
Possess cross-cultural and cross-functional collaboration skills
Strong work ethic, good attitude and team player
Qualifications:
BS degree in Business Analytics/MIS or Computer Science, Mathematics, Statistics or Engineering
Competencies:
Conveys a sense of urgency and drives issues to closure, persists despite obstacles and opposition;
Well organized when working under pressure;
Ability to work and thrive in a flexible matrix organization with focus on networking;
Navigates effectively in a changing environment where competing priorities require flexibility.

