We're looking for a skilled IT Manager to to implement and effectively use information technology within our growing company. The IT Manager is a brand new role within Iron Hill Brewery, created to ensure the streamlined operation of the IT Department in alignment with the business objectives and business intelligence of the organization.

Here's What We're Looking For:
Bachelor's degree in IS or related equivalent work experience in an Information Systems position;
5 years minimum experience in delivering medium-scale technical solutions;
Experience leading software application selection, system design, process design, testing, training, and implementation initiatives;
Thorough knowledge and understanding of systems, procedures, and technology/project life cycles;
