About Iron Hill Brewery & Restaurant :

Founded by home brewers Kevin Finn and Mark Edelson and restaurateur Kevin Davies in Newark, DE twenty years ago, Iron Hill Brewery & Restaurant has blossomed from one restaurant and brewery to twelve locations across the mid-Atlantic region.

Each restaurant is dedicated to producing and serving top-quality hand-crafted beers and cuisine in a warm and hospitable setting, and all are open seven days a week for lunch and dinner. In 2014, Zagat honored Iron Hill by naming them the most popular restaurant in Philadelphia, and their beers have earned 45 medals from the Great American Beer Festival in an unbroken 20-year winning streak that continues today. They debuted their 12 th location, in Huntingdon Valley, PA, in July 2016.

